import React, { useContext, useEffect, useRef ,useState} from 'react';
import noteContext from '../context/notes/NoteContext';
import NoteItem from './NoteItem';
import { Addnote } from './Addnote';

const Notes = () => {
    const context = useContext(noteContext);
    const { notes, getNote } = context;

    useEffect(() => {
        getNote();
    }, [getNote]);
    const ref = useRef(null)

    const updatenote = (currentnote) => {
        ref.current.click();
        setNote({etitle:currentnote.title,edescription:currentnote.description,etag:currentnote.tag});
    }
    const { addNote } = context;
    const [note, setNote] = useState({ etitle: "", edescription: "", etag: "" });
    const handleClick = (e) => {
        e.preventDefault();

    };

    const onChange = (e) => {
        setNote({ ...note, [e.target.name]: e.target.value });
    };
    return (
        <>
            <Addnote />
            <button type="button" ref={ref} className="btn btn-primary" data-bs-toggle="modal" data-bs-target="#exampleModal" style={{"display":"none"}}>
                Launch demo modal
            </button>


            <div className="modal fade" id="exampleModal" tabIndex="-1" aria-labelledby="exampleModalLabel" aria-hidden="true" >
                <div className="modal-dialog">
                    <div className="modal-content">
                        <div className="modal-header">
                            <h1 className="modal-title fs-5" id="exampleModalLabel">Modal title</h1>
                            <button type="button" className="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
                        </div>
                        <div className="modal-body">
                            <form>
                                <div className="mb-3">
                                    <label htmlFor="title" className="form-label">Title</label>
                                    <input type="text" className="form-control" id="etitle" name="etitle"  value={note.etitle} onChange={onChange} />
                                </div>
                                <div className="mb-3">
                                    <label htmlFor="description" className="form-label">Description</label>
                                    <textarea className="form-control" id="edescription" name="edescription" value={note.edescription} onChange={onChange}></textarea>
                                </div>
                                <div className="mb-3">
                                    <label htmlFor="tag" className="form-label">Tag</label>
                                    <input type="text" className="form-control" id="etag" name="etag" value={note.etag} onChange={onChange} />
                                </div>

                            </form>
                        </div>
                        <div className="modal-footer">
                            <button type="button" className="btn btn-secondary" data-bs-dismiss="modal">Close</button>
                            <button type="button" className="btn btn-primary" onClick={handleClick}>Update Changes</button>
                        </div>
                    </div>
                </div>
            </div>
            <div className="row my-3">
                <h1>Your Notes</h1>
                {notes.map((note) => {
                    return <NoteItem key={note._id} updatenote={updatenote} note={note} />
                })}
            </div>
        </>
    );
};

export default Notes;
